insert into services (user_id, name, description, price, image_path) values (1,'Cats Grooming', 'Making cats look great is our passion! Our academy-trained Pet Stylists have over 800 hours of hands-on grooming instruction that includes bathing, trimming & styling at least 200 dogs of all breeds & sizes plus annual safety certification. We offer complete bath & haircut services and walk-in services. Book your pet salon appointment today!', 59, '/images/catGrooming.jpg');
insert into services (user_id, name, description, price, image_path) values (2,'Dogs Grooming', 'Making dogs look great is our passion! Our academy-trained Pet Stylists have over 800 hours of hands-on grooming instruction that includes bathing, trimming & styling at least 200 dogs of all breeds & sizes plus annual safety certification. We offer complete bath & haircut services and walk-in services. Book your pet salon appointment today!', 59, '/images/dogGrooming.jpg');
insert into services (user_id, name, description, price, image_path) values (3,'Cats training', 'Our famous cat training classes can help them learn how to behave appropriately at home and on-the-go. Our Accredited Pet Trainers teach fun & eﬀective group & private classes through positive reinforcement.', 599, '/images/catTyping.jpg');
insert into services (user_id, name, description, price, image_path) values (4,'Dogs training', 'Whether you have a young pup, older dog or a rescue, our dog training classes can help them learn how to behave appropriately at home and on-the-go. Our Accredited Pet Trainers teach fun & eﬀective group & private classes through positive reinforcement.', 59, '/images/dogTraining.jpg');
insert into services (user_id, name, description, price, image_path) values (1,'Cats walking', 'Every cat walker on the site has been hand-reviewed and approved by the Rover team. They’ve also completed a general background check.', 30, '/images/catWalker.jpg');
insert into services (user_id, name, description, price, image_path) values (2,'Dogs walking', 'Making dogs look great is our passion! Our academy-trained Pet Stylists have over 800 hours of hands-on grooming instruction that includes bathing, trimming & styling at least 200 dogs of all breeds & sizes plus annual safety certification. We offer complete bath & haircut services and walk-in services. Book your pet salon appointment today!', 30, '/images/dogWalker.jpg');
insert into services (user_id, name, description, price, image_path) values (3,'dog Hotel', 'Our comfortable accommodations & safety-certified associates provide a welcoming place for dogs & cats to stay while you’re away! Guests will feel at home with the around-the-clock care of our pet-loving staff. We offer a safe, clean, temperature-controlled environment, playtime, exercise, healthy meals & more. Book the ultimate staycation destination for your pet now!', 109, '/images/dogHotelBed.jpg');

